import React, { useState } from 'react';

function UseStateObject(){
    const myObj = {
        name:'jack',
        height:6.5,
        age:25,
        isYoung:true
    }
    const [obj,setObj] = useState(myObj);

    const handleChange = (e)=>{
        // console.log('hello');
        setObj()
        
    }
    return(
        <>
        <h1>useState with Object</h1>
        <h2>Name: {myObj.name}</h2>
        <h2>Height: {myObj.height}</h2>
        <h2>Age: {myObj.age}</h2>
        <h2>isYoung: {myObj.isYoung.toString()}</h2>
        <button className='btn btn-primary' onClick={handleChange}>Update Object</button>
        </>
    )
}
export default UseStateObject;
